import React from 'react';
import { useSelector } from 'react-redux';
import PropTypes from 'prop-types';

// app
import { RegisterClaimCardInformationView } from './RegisterClaimCardInformation.view';
import { selectLossQualifiers } from 'stores';

RegisterClaimCardInformation.prototype = {
  claimantNames: PropTypes.array.isRequired,
  claimForm: PropTypes.object,
  fields: PropTypes.object.isRequired,
  referralValues: PropTypes.array.isRequired,
  policyInformation: PropTypes.object.isRequired,
  existingClaimInfo: PropTypes.object,
  currencies: PropTypes.array.isRequired,
  resetKey: PropTypes.number,
};
export default function RegisterClaimCardInformation({
  claimantNames,
  claimForm,
  fields,
  referralValues,
  policyInformation,
  existingClaimInfo,
  currencies,
  resetKey,
}) {
  const lossQualifiers = useSelector(selectLossQualifiers);

  return (
    <RegisterClaimCardInformationView
      resetKey={resetKey}
      fields={fields}
      claimForm={claimForm}
      policyInformation={policyInformation}
      claimantNames={claimantNames}
      referralValues={referralValues}
      existingClaimInfo={existingClaimInfo}
      currencies={currencies}
      lossQualifiers={lossQualifiers}
    />
  );
}
